// Pasta de destino para os vídeos
const destinationFolder = './temp';

// Função para fazer o download do vídeo
async function downloadVideo(url, filename, progressBar) {
  const fullPath = path.join(destinationFolder, filename);

  const response = await axios({
    method: 'get',
    url: url,
    responseType: 'stream',
  });

  const writer = fs.createWriteStream(fullPath);
  const totalLength = response.headers['content-length'];
  let downloaded = 0;

  response.data.on('data', (chunk) => {
    downloaded += chunk.length;
    if (totalLength) {
      progressBar.update(downloaded / totalLength);
    } else {
      progressBar.tick(chunk.length);
    }
  });

  response.data.pipe(writer);

  return new Promise((resolve, reject) => {
    writer.on('finish', resolve);
    writer.on('error', reject);
  });
}

// Função principal para baixar todos os vídeos
async function downloadAllVideos() {
  // Cria a pasta de destino se não existir
  if (!fs.existsSync(destinationFolder)) {
    fs.mkdirSync(destinationFolder);
  }

  // Itera sobre cada link e faz o download
  for (let i = 0; i < videoLinks.length; i++) {
    const url = videoLinks[i];
    const filename = `video${i + 1}.mp4`;

    console.log(`Iniciando o download de ${url}`);

    try {
      const progressBar = new ProgressBar('[:bar] :percent :etas', {
        total: 1,
        width: 20,
      });

      await downloadVideo(url, filename, progressBar);
      progressBar.terminate();
      console.log(`Download de ${url} concluído com sucesso.`);
    } catch (error) {
      console.error(`Erro ao fazer o download de ${url}: ${error.message}`);
    }
  }
}

// Inicia o processo de download
downloadAllVideos();